import React from 'react';

import SCP_Subject from './scp-subject.js'
import { Stack } from '@mui/material';
import { useState, useEffect } from "react";


export default () => {   
 
  const [data, setData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
 
  useEffect(() => {
    fetch(`https://api.github.com/users/eunit99/repos`)
      .then(response => response.json())
      .then((usefulData) => {
        console.log(usefulData);
        setLoading(false);
        setData(usefulData);
      })
      .catch((e) => {
        console.error(`An error occurred: ${e}`)
      });
  }, []);
    return (
        <>
        <br/><br/>
        <Stack direction={'column'} spacing={'3vh'} alignItems={'center'} sx={{marginBottom: '10vh'}}>
            <h2>SCP subjects:</h2>
            {fetch('/api/fetch/next').then((subjects)=>subjects.map((subject) => <SCP_Subject subject={subject}/>))}
        </Stack>
        </>
    )
}
